import React from "react";
import { Box, Heading } from "@chakra-ui/react";

function TrendingProduct(props) {
  // eslint-disable-next-line

  return (
    <>
      <ProdContainer {...props}>
        <ProdContainerHeader />
      </ProdContainer>
    </>
  );
}
const ProdContainerHeader = () => {
  return (
    <>
      <Box
        pl={["1.8rem"]}
        pt={["1.5rem"]}
        display="flex"
        justifyContent={["center","flex-start"]}
      >
        <Heading fontSize={["1.5rem", "1.75rem"]} fontWeight={["500","600"]} as="h2" color="#2c2c2c">
          <Box display={["inline-block"]}>Hot Products</Box>
          <Box
            borderBottom="2px solid #e97730"
            py={["1"]}
            pos={["relative"]}
            w={["75%","60%"]}
            left={["4"]}
            right={["null","4"]}
          ></Box>
        </Heading>
      </Box>
    </>
  );
};
const ProdContainer = ({ children, ...props }) => {
  return <Box as="prodContainer">{children}</Box>;
};

export default TrendingProduct;
